(1, 64, 'Historia de la facultad', 'historia-de-la-facultad', '<p style=\"text-align: center;\"><img src=\"images/uady_logo_amarillo.png\" alt=\"\" width=\"139\" height=\"229\" /></p>\r\n<p>En el mes de septiembre de 1960 se celebró en Yucatán el IV Congreso de la Sociedad Matemática Mexicana, después del cual se reunieron maestros de Matemáticas y Física de la Escuela Preparatoria y de la Facultad de Ingeniería de Universidad de Yucatán para elaborar un plan, cuyo objetivo sería la creación de un Departamento de Estudios Físicos-Matemáticos para promover el interés de estas ciencias y difundirlas, así como la preparación de los maestros encargados de impartirlas.</p>\r\n<p>El acta de constitución del departamento de Estudios Físico-Matemáticos, así como sus reglamentos, es de fecha 26 de octubre de 1960; sin embargo fué hasta el 6 de febrero de 1962, que el Consejo Universitario lo reconoció oficialmente, cambiándole el nombre por Centro de Estudios Físico-Matemáticos, el cual se inauguró el 24 de septiembre de 1962.</p>\r\n<p>Sus objetivos primordiales fueron \"promover la afición y el estudio de ambas ciencias mediante cursillos, conferencias, publicaciones, etc., así como mejorar la enseñanza principal mente de las Matemáticas, de acuerdo con las corrientes de la didáctica moderna\".</p>\r\n<p>El centro de Estudios Físico-Matemáticos tuvo como director el Ing. Carlos Romero Campos y como secretario al Br. Enrique Cárdenas Pérez-Abreu, contaba con quince miembros.</p>\r\n<p>La Escuela de Matemáticas fue inaugurada el 20 de septiembre de 1963 por el Rector de la Universidad de Yucatán, Abog. Francisco Repetto Milán, teniendo como antecedente el Centro de Estudios Físico-Matemáticos. Comenzó a funcionar en salones del tercer piso del edificio central de la Universidad de Yucatán, en el cual permaneció 14 años. Posteriormente se trasladó al local de la Facultad de Ingeniería en los ex-terrenos del Fénix donde permaneció durante 9 años, y en mayo de 1986 se reubicó sobre Circuito Colonias frente a la Unidad Habitacional Morelos.</p>\r\n<p>Actualmente y desde el mes de mayo de 2003, las instalaciones de la Facultad de Matemáticas están ubicadas en Anillo Periférico Norte Km. 33.5 y forma parte del Campus de Ingeniería y Ciencias Exactas de la Universidad Autónoma de Yucatán.</p>', '', 1, 8, '2020-02-07 03:45:57', 135, '', '2020-03-21 06:30:26', 135, 0, '0000-00-00 00:00:00', '2020-02-07 03:45:57', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"1\",\"show_intro\":\"1\",\"info_block_position\":\"\",\"info_block_show_title\":\"0\",\"show_category\":\"0\",\"link_category\":\"0\",\"show_parent_category\":\"0\",\"link_parent_category\":\"0\",\"show_associations\":\"0\",\"show_author\":\"0\",\"link_author\":\"0\",\"show_create_date\":\"0\",\"show_modify_date\":\"0\",\"show_publish_date\":\"0\",\"show_item_navigation\":\"0\",\"show_icons\":\"0\",\"show_print_icon\":\"0\",\"show_email_icon\":\"0\",\"show_vote\":\"0\",\"show_hits\":\"0\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 8, '', '', 1, 72, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(2, 66, 'INICIO', 'inicio', '<p>On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pain</p>', '', 1, 8, '2020-02-07 04:00:08', 135, '', '2020-04-02 22:46:46', 135, 0, '0000-00-00 00:00:00', '2020-02-07 04:00:08', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 7, '', '', 1, 1661, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(3, 68, 'Misión y Visión (Objetivos)', 'mision-y-vision-objetivos', '<p style=\"text-align: center;\"><img style=\"margin-right: 140px; margin-left: 140px;\" src=\"images/logoLCC.jpg\" width=\"750\" height=\"154\" /></p>\r\n<p style=\"text-align: justify;\">El propósito del plan de estudios de la Licenciatura en Ciencias de la Computación es:</p>\r\n<p style=\"text-align: justify;\"><b><i>Formar profesionales competentes en el área de las ciencias de la computación para desarrollar y gestionar tecnología computacional; realizar actividades de investigación científica; diseñar e implementar software de base y software de aplicación, novedosos y eficientes; considerando la estructura, operación y necesidades de información de las organizaciones, con apego a la ética profesional y el servicio a la sociedad.</i></b></p>\r\n<div style=\"text-align: center;\"><iframe src=\"https://www.youtube.com/embed/paP45j1LIsM\" width=\"560\" height=\"315\" frameborder=\"0\" allowfullscreen=\"allowfullscreen\"></iframe></div>', '', 1, 8, '2020-02-07 06:52:00', 135, '', '2020-03-21 06:41:06', 135, 0, '0000-00-00 00:00:00', '2020-02-07 06:52:00', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 4, 6, '', '', 1, 21, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(4, 69, 'Perfil de ingreso (Objetivos)', 'perfil-de-ingreso-objetivos', '<p> </p>\r\n<p style=\"text-align: center;\"><img src=\"images/logoLCC.jpg\" alt=\"\" /></p>\r\n<p style=\"text-align: justify;\">Las competencias deseables, para el perfil de ingreso, seleccionadas de entre las establecidas para el Sistema Nacional de Bachillerato, según el acuerdo 444 de la SEP, son:</p>\r\n<p style=\"text-align: justify;\"><b><i>Matemáticas</i></b></p>\r\n<ol type=\"1\">\r\n<li style=\"text-align: justify;\">Construye e interpreta modelos matemáticos mediante la aplicación de procedimientos aritméticos, algebraicos, geométricos y variacionales, para la comprensión y análisis de situaciones reales, hipotéticas o formales.</li>\r\n<li style=\"text-align: justify;\">Formula y resuelve problemas matemáticos, aplicando diferentes enfoques.</li>\r\n<li style=\"text-align: justify;\">Explica e interpreta los resultados obtenidos mediante procedimientos matemáticos y los contrasta con modelos establecidos o situaciones reales.</li>\r\n<li style=\"text-align: justify;\">Argumenta la solución obtenida de un problema, con métodos numéricos, gráficos, analíticos o variacionales, mediante el lenguaje verbal, matemático y el uso de las tecnologías de la información y la comunicación.</li>\r\n<li style=\"text-align: justify;\">Analiza las relaciones entre dos o más variables de un proceso social o natural para determinar o estimar su comportamiento.</li>\r\n<li style=\"text-align: justify;\">Cuantifica, representa y contrasta experimental o matemáticamente las magnitudes del espacio y las propiedades físicas de los objetos que lo rodean.</li>\r\n<li style=\"text-align: justify;\">Elige un enfoque determinista o uno aleatorio para el estudio de un proceso o fenómeno, y argumenta su pertinencia.</li>\r\n<li style=\"text-align: justify;\">Interpreta tablas, gráficas, mapas, diagramas y textos con símbolos matemáticos y científicos.</li>\r\n</ol>', '', 1, 8, '2020-02-07 06:58:01', 135, '', '2020-03-21 06:40:30', 135, 0, '0000-00-00 00:00:00', '2020-02-07 06:58:01', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 15, 5, '', '', 1, 34, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(5, 70, 'Librería con realidad aumentada', 'libreria-con-realidad-aumentada', '<p style=\"text-align: justify;\"> La biblioteca del Campus de Ciencias Exactas e Ingeniería ofrece más de 48,568 volúmenes y en muchas ocasiones requiere mucho tiempo la búsqueda de uno de éstos. Una aplicación basada en Realidad Aumentada propone resolver el desconocimiento espacial de los usuarios de la biblioteca.</p>\r\n', '\r\n<p style=\"text-align: justify;\">Con una colección de más de 48,568 volúmenes en la biblioteca de Ingeniería y Ciencias Exactas de la Universidad Autónoma de Yucatán, la tarea de buscar un libro puede requerir mucho tiempo y ser muy frustrante, especialmente para los alumnos que están conociendo apenas las instalaciones. El sistema desarrollado implementa una aplicación basada en Realidad Aumentada (AR) que tiene como objetivo resolver el desconocimiento espacial de los usuarios en la biblioteca, al brindarnos un sistema de búsqueda en estanterías mediante Realidad Aumentada. Esta aplicación ayuda a los estudiantes y a los usuarios en general, al proporcionar una guía móvil con los servicios de información de la biblioteca. En el artículo escrito por el autor del sistema, se presentan los resultados de un estudio piloto que demuestran que las experiencias y el rendimiento del usuario en la biblioteca se mejoraron mediante el uso de tecnología de realidad aumentada.</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_1_Cevera_Uribe{/gallery}</p>\r\n<h4>Trabajo Ralizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_1_Cevera_Uribe/cerverauribe2017.pdf{/aridoc}</p>\r\n<p> </p>', 1, 11, '2020-02-07 07:28:28', 135, '', '2020-04-12 15:06:55', 135, 0, '0000-00-00 00:00:00', '2020-02-07 07:28:28', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_1_Cevera_Uribe\\/Captura de pantalla 2019-09-23 a la(s) 12.19.29.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 24, 3, '', '', 1, 75, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(6, 77, 'Modelado 3D de Nave de Star Wars', 'modelado-3d-de-nave-de-star-wars', '<p>Este artículo muestra la realización del modelado 3D de la nave XWing de Start Wars.</p>\r\n', '\r\n<p>En este proyecto, se realizó un modelado 3D de la nave XWing de la saga de Star Wars, agregándole animaciones básicas y una escenografía para simular una escena de la película.</p>\r\n<p>En el siguiente documento se muestra todo lo que conllevó realizar el modelado:</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_10_Modelado3D_Nave/Proy_Integrador_Nave.pdf{/aridoc}</p>\r\n<p> </p>', 1, 10, '2020-02-28 09:38:21', 135, '', '2020-04-12 14:28:35', 135, 0, '0000-00-00 00:00:00', '2020-02-28 09:38:21', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/articulo_introduccion\\/nave_star_wars.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"1\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 8, 4, '', '', 1, 66, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(7, 80, 'Simulador de Sistema Operativo y Lenguaje Ensamblador', 'simulador-de-sistema-operativo-y-lenguaje-ensamblador', '<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y también el software que permite traducir código fuente escrito en ensamblador a código de máquina del simulador.</p>\r\n', '\r\n<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y también el software que permite traducir código fuente escrito en ensamblador a código de máquina del simulador; además de otras herramientas de programación de sistemas, como son: traductores, editores y subrutinas del sistema operativo. El programa, simula una computadora virtual con una arquitectura simplificada y módulos para generar ejecutables a partir del lenguaje ensamblador, un módulo para manejo de procesos, módulo para manejo de memoria y una sección para el control de simulaciones. El simulador permite a los usuarios implementar rutinas para ampliar las funcionalidades del sistema. El simulador también se puede emplear para hacer prácticas para ayudar en la comprensión de la arquitectura de las computadoras, el manejo de lenguaje máquina, el manejo de lenguaje ensamblador y el funcionamiento de un sistema operativo con sus algoritmos de gestión.</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_3_Ayala{/gallery}</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_3_Ayala/IJCTT-V51P109.pdf{/aridoc}</p>\r\n<p> </p>', 1, 9, '2020-03-04 23:35:11', 135, '', '2020-04-11 20:44:30', 135, 0, '0000-00-00 00:00:00', '2020-03-04 23:35:11', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/articulo_introduccion\\/Collage 2020-03-13 01_49_44.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 19, 7, '', '', 1, 82, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(8, 81, 'Laboratorio de Interconexión Inalámbrica', 'laboratorio-de-interconexion-inalambrica', '<p>Se diseñó un laboratorio para representar un ambiente de interconexión móvil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y cámaras de video vigilancia.</p>\r\n', '\r\n<p>Se diseñó un laboratorio para representar un ambiente de interconexión móvil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y cámaras de video vigilancia. Este entorno se utiliza para la realización de prácticas y proyectos para las materias de computación impartidas en la Facultad de Matemáticas. El sistema permite analizar el proceso de la comunicación, los protocolos de red y sus características, esto como tema de estudio de los modelos OSI y TCP/IP. También, se utilizan equipos de video vigilancia y se obtiene video en tiempo real como datos utilizables por otras aplicaciones.</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_9_Cervera{/gallery}</p>\r\n<h4>Manual de Utilización</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_9_Cervera/Modelo_Didactico_manual_Laboratorio_de_interconexion.pdf{/aridoc}</p>', 1, 12, '2020-03-04 23:39:00', 135, '', '2020-04-11 20:45:56', 135, 0, '0000-00-00 00:00:00', '2020-03-04 23:39:00', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/articulo_introduccion\\/Captura de pantalla 2019-09-23 a la(s) 13.32.23.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 13, 2, '', '', 1, 25, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(9, 82, 'Uno Aritmético ', 'uno-aritmetico', '<p>Se adaptó el juego de mesa UNO a una aplicación móvil que implementa las operaciones aritméticas básicas y fomenta así el pensamiento aritmético.</p>\r\n', '\r\n<p>Desarrolla en los niños habilidades para manejar las cuatro operaciones aritméticas básicas y fomentar así el pensamiento aritmético. El contenido matemático que tiene esta adaptación consiste en las propiedades de los números reales. Se adaptó el juego de mesa UNO a una aplicación móvil para el dispositivo Samsung Galaxy Tab de 10 pulgadas, sin embargo, se modificó para ser ejecutado en otros dispositivos como los smartphones, con diversas capacidades de procesamiento y diferentes tamaños de pantallas. Se puede jugar en modalidad de un jugador, dos y hasta cuatro jugadores.</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_4_Basto_Uno{/gallery}</p>\r\n<h4>Manual de Usuario Uno Aritmético</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"650\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_4_Basto_Uno/Manual_Usuario_Uno_Aritmetico.pdf{/aridoc}</p>\r\n<p> </p>', 1, 10, '2020-03-04 23:39:46', 135, '', '2020-04-11 20:47:21', 135, 0, '0000-00-00 00:00:00', '2020-03-04 23:39:46', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/articulo_introduccion\\/Captura de pantalla 2019-09-23 a la(s) 13.01.43.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 41, 7, '', '', 1, 97, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(11, 84, 'Vehículos Autónomos: Detección de obstáculos con la aplicación de redes neuronales convolucionales', 'vehiculos-autonomos-deteccion-de-obstaculos-con-la-aplicacion-de-redes-neuronales-convolucionales', '<p>Se propone el desarrollo de un modelo neuronal CNN con arquitectura codificadora-decodificadora para la clasificación de obstáculos en imágenes de un sistema de visión monocular, a cargo de L.C.C. Albert Aarón Cervera Uribe.</p>\r\n', '\r\n<p>En años recientes, el uso de CNN’s ha llevado al desarrollo de trabajos notables en clasificación de imágenes, sin embargo, en tareas de vehículos autónomos, la salida deseada de la red debe incluir no sólo la etiqueta de predicción, pero la localización de objetos de interés preferentemente a nivel de píxeles.</p>\r\n<p>Este trabajo propone el desarrollo de un modelo neuronal CNN con arquitectura codificadora-decodificadora para la detección de obstáculos en imágenes de un sistema de visión monocular para vehículos autónomos.</p>\r\n<p>En este reporte se muestran los resultados obtenidos en materia de detección de obstáculos con la aplicación de redes neuronales convolucionales.</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_2_Cervera_Uribe/Towards_Autonomous_Vehicles_with_CNN_[Albert_Cervera-Uribe].pdf{/aridoc}</p>', 1, 11, '2020-03-05 08:17:18', 135, '', '2020-04-12 16:45:38', 135, 0, '0000-00-00 00:00:00', '2020-03-05 08:17:18', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_2_Cervera_Uribe\\/vehiculos_autonomos.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{