(22, 102, 'Propósito del sitio', 'proposito-del-sitio', '<p>El portal “Jóvenes en las Ciencias de la Computación” es un espacio para compartir materiales de divulgación científica en el área de las Ciencias de la Computación e información de productos generados por la comunidad de los programas de computación de la Facultad de Matemáticas.</p>\r\n<p>Se incluyen secciones con información escrita en lenguaje accesible para los jóvenes y en diversos formatos: artículos, infografías, videos y galerías fotográficas.</p>\r\n<p>El espacio <strong>Futuro y Ciencia</strong>, está dedicado a la publicación de contenido sobre las diversas áreas de las Ciencias de la Computación: inteligencia artificial, redes de computadoras, realidad virtual, aprendizaje automático, internet de las cosas, etc. Es posible recibir aportaciones de alumnos, profesores o divulgadores de la ciencia externos a la institución, siguiendo los lineamientos correspondientes.</p>\r\n<p>Nuestro sitio está dirigido a adolescentes y adultos que buscan conocer con mayor detalle lo que se estudia en la carrera de Ciencias de la Computación y acceder a material de divulgación científica y comprender las aplicaciones que tiene las Ciencias de la Computación en la vida cotidiana.</p>', '', 1, 8, '2020-03-23 21:34:02', 135, '', '2020-04-23 06:29:25', 136, 0, '0000-00-00 00:00:00', '2020-03-23 21:34:02', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 3, 2, '', '', 1, 9, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
