(25, 139, ' Aplicación de Aprendizaje Aritmético \"Quita y Pon\"', 'aplicacion-de-aprendizaje-aritmetico-quita-y-pon', '<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y también el software que permite traducir código fuente escrito en ensamblador a código de máquina del simulador.</p>\r\n', '\r\n<p>Este juego en una aplicación móvil que consiste en completar operaciones aritméticas, de diferentes grados de dificultad, con los operadores y operandos adecuados para resolver correctamente la misma.</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_7_Basto_QuitayPon{/gallery}</p>\r\n<h4>Manual de Usuario \"Quita y Pon\":</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"650\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_7_Basto_QuitayPon/Manual_Usuario-QuitayPon.pdf{/aridoc}</p>\r\n<p> </p>', 1, 10, '2020-04-03 13:30:33', 136, '', '2020-04-12 14:16:10', 135, 0, '0000-00-00 00:00:00', '2020-04-03 13:30:33', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_7_Basto_QuitayPon\\/imagen1.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\