(26, 140, '¿Cuál Va con Cuál?', 'cual-con-cual', '<p>Aplicación móvil de memorama para niños.</p>\r\n', '\r\n<p>El juego es una aplicación móvil de un memorama de números cardinales y ordinales en el cual se deben buscar parejas de números, uno escrito de forma cardinal (1,2,3,4,…) y el otro en forma ordinal (uno, dos, tres, cuatro, …).</p>\r\n<p>{gallery}articulos/esto_hacemos/Articulo_6BastoCualvaconcual{/gallery}</p>\r\n<h4>Manual de Usuario \"Cuál va con Cuál\"</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"650\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_6BastoCualVaConCual/Manual_Usuario-Cualvaconcual.pdf{/aridoc}</p>\r\n<p> </p>', 1, 10, '2020-04-03 13:33:33', 136, '', '2020-04-12 14:16:57', 135, 0, '0000-00-00 00:00:00', '2020-04-03 13:33:33', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_6BastoCualVaConCual\\/Captura5.PNG\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_u