(27, 150, 'Infografía \"Ethernet\"', 'infografia-wifi-vs-ethernet', '<p> </p>\r\n<p><img src=\"images/articulos/futuro_y_ciencia/articulo_infografia_ethernet/ethernet_Infografía - copia.png\" alt=\"\" /></p>', '', 1, 15, '2020-04-09 22:39:01', 135, '', '2020-04-14 00:34:59', 135, 0, '0000-00-00 00:00:00', '2020-04-09 22:39:01', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/futuro_y_ciencia\\/articulo_infografia_ethernet\\/intro.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 21, 1, '', '', 1, 119, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(28, 134, ' Realidad Aumentada en un croquis 3D interactivo de la Facultad de Matemáticas', 'realidad-aumentada-en-un-croquis-3d-interactivo-de-la-facultad-de-matematicas', '<p>Se realizó una aplicación móvil de Realidad Aumentada que despliega un escenario virtual tridimensional de la facultad de matemáticas</p>\r\n', '\r\n<p>Como parte de un proyecto, se realizó una aplicación móvil de Realidad Aumentada que despliegue un escenario virtual tridimensional de la facultad de matemáticas de tal manera que el usuario pueda identificar la ubicación de edificios principales de la facultad de matemáticas, así como los pasillos que dirigen a estos, desde una perspectiva general y de manera interactiva.</p>\r\n<p>En el siguiente documento se describe todo lo que conllevó la realización del proyecto.</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_12_RealidadAumentada_FMAT/Proyecto_integrador_Alan.pdf{/aridoc}</p>\r\n<p> </p>', 1, 10, '2020-04-11 16:25:28', 135, '', '2020-04-12 15:09:12', 135, 0, '0000-00-00 00:00:00', '2020-04-11 16:25:28', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_12_RealidadAumentada_FMAT\\/croquis_fmat.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"1\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 1, '', '', 1, 15, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(29, 135, 'Ubicampus, la aplicación para ubicar salones escolares en FMAT', 'ubicampus-la-aplicacion-para-ubicar-salones-escolares-en-fmat', '<p> Aplicación de realidad aumentada que sirve para visualizar información de los salones de clase y de los departamentos de la Facutlad de Matemáticas</p>\r\n', '\r\n<p>Este proyecto surge de la problemática de que muchos estudiantes que están empezando a estudiar en la Facultad de Matemáticas no pueden encontrar sus salones de clases, se pierden o no están seguros de su salón de clases; también no saben ubicar bien los departamentos de la facultad.</p>\r\n<p>Se propone la creación una aplicación de realidad aumentada con el nombre de “Ubicampus”, en la cual, el usuario podrá enfocar su cámara en el identificador de un salón (D3, H5), y ésta arrojará una lista donde se podrá visualizar cuándo se ocupa el salón, por qué materia y qué maestro la imparte. De igual modo, para los departamentos de la universidad, esta aplicación desplegará información referente al departamento, indicándole al usuario los servicios que éste presenta (por ejemplo, en Control Escolar se deplegará la función, así como trámites que puedes realizar tal como solicitud de constancias).</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_13_RealidadAumentada_Salones/ReporteFinal_Cervera.pdf{/aridoc}</p>\r\n<p> </p>', 1, 10, '2020-04-11 16:26:00', 135, '', '2020-04-12 15:38:00', 135, 0, '0000-00-00 00:00:00', '2020-04-11 16:26:00', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_13_RealidadAumentada_Salones\\/clir.png\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"1\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 5, 0, '', '', 1, 7, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(30, 136, 'Acorazado Imperial Japonés Yamato en 3D', 'acorazado-imperial-japones-yamato', '<p>Modelado, animación y renderización de un barco de guerra de la Segunda Guerra Mundial</p>\r\n', '\r\n<p>Modelado, animación y renderización en 3D de un barco de guerra de la Segunda Guerra Mundial</p>\r\n<p> <img src=\"images/articulos/esto_hacemos/Articulo_11_Modelado3D_Barco/modelado_barco.jpg\" alt=\"\" /></p>\r\n<p><img src=\"images/articulos/esto_hacemos/Articulo_11_Modelado3D_Barco/modelado_barco2.jpg\" alt=\"\" /></p>\r\n<p>En el siguiente documento se muestra todo lo que conllevó realizar el modelado:</p>\r\n<h4>Trabajo Realizado</h4>\r\n<p>{aridoc engine=\"pdfjs\" width=\"100%\" height=\"700\"}http://localhost/serviciosocial/images/articulos/esto_hacemos/Articulo_11_Modelado3D_Barco/Proy_Integrador_Yamato.pdf{/aridoc}</p>\r\n<p> </p>', 1, 10, '2020-02-28 09:38:21', 135, '', '2020-04-12 15:10:02', 135, 0, '0000-00-00 00:00:00', '2020-02-28 09:38:21', '0000-00-00 00:00:00', '{\"image_intro\":\"images\\/articulos\\/esto_hacemos\\/Articulo_11_Modelado3D_Barco\\/modelado_barco2.jpg\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"1\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"