(15, 'index.php?option=com_content&view=article&id=1', 'index.php?option=com_content&view=article&id=1:historia-de-la-facultad&catid=8', 'Historia de la facultad', ' En el mes de septiembre de 1960 se celebró en Yucatán el IV Congreso de la Sociedad Matemática Mexicana, después del cual se reunieron maestros de Matemáticas y Física de la Escuela Preparatoria y de la Facultad de Ingeniería de Universidad de Yucatán para elaborar un plan, cuyo objetivo sería la creación de un Departamento de Estudios Físicos-Matemáticos para promover el interés de estas ciencias y difundirlas, así como la preparación de los maestros encargados de impartirlas. El acta de constitución del departamento de Estudios Físico-Matemáticos, así como sus reglamentos, es de fecha 26 de octubre de 1960; sin embargo fué hasta el 6 de febrero de 1962, que el Consejo Universitario lo reconoció oficialmente, cambiándole el nombre por Centro de Estudios Físico-Matemáticos, el cual se inauguró el 24 de septiembre de 1962. Sus objetivos primordiales fueron \"promover la afición y el estudio de ambas ciencias mediante cursillos, conferencias, publicaciones, etc., así como mejorar la enseñanza principal mente de las Matemáticas, de acuerdo con las corrientes de la didáctica moderna\". El centro de Estudios Físico-Matemáticos tuvo como director el Ing. Carlos Romero Campos y como secretario al Br. Enrique Cárdenas Pérez-Abreu, contaba con quince miembros. La Escuela de Matemáticas fue inaugurada el 20 de septiembre de 1963 por el Rector de la Universidad de Yucatán, Abog. Francisco Repetto Milán, teniendo como antecedente el Centro de Estudios Físico-Matemáticos. Comenzó a funcionar en salones del tercer piso del edificio central de la Universidad de Yucatán, en el cual permaneció 14 años. Posteriormente se trasladó al local de la Facultad de Ingeniería en los ex-terrenos del Fénix donde permaneció durante 9 años, y en mayo de 1986 se reubicó sobre Circuito Colonias frente a la Unidad Habitacional Morelos. Actualmente y desde el mes de mayo de 2003, las instalaciones de la Facultad de Matemáticas están ubicadas en Anillo Periférico Norte Km. 33.5y forma parte del Campus de Ingeniería y Ciencias Exactas de la Universidad Autónoma de Yucatán. ', '2020-04-13 16:43:42', '8a2a119ffb1c7a781d3e9c1c05187504', 1, 1, 1, '*', '2020-02-07 03:45:57', '0000-00-00 00:00:00', '2020-02-07 03:45:57', '0000-00-00 00:00:00', 0, 0, 4, );
