(16, 'index.php?option=com_content&view=article&id=2', 'index.php?option=com_content&view=article&id=2:inicio&catid=8', 'INICIO', ' On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pain ', '2020-04-13 16:43:44', '37ef264c53ea0f4a5d41de3fbae4da7f', 1, 1, 1, '*', '2020-02-07 04:00:08', '0000-00-00 00:00:00', '2020-02-07 04:00:08', '0000-00-00 00:00:00', 0, 0, 4, ),
(17, 'index.php?option=com_content&view=article&id=3', 'index.php?option=com_content&view=article&id=3:mision-y-vision-objetivos&catid=8', 'Misión y Visión (Objetivos)', ' El propósito del plan de estudios de la Licenciatura en Ciencias de la Computación es: Formar profesionales competentes en el área de las ciencias de la computación para desarrollar y gestionar tecnología computacional; realizar actividades de investigación científica; diseñar e implementar software de base y software de aplicación, novedosos y eficientes; considerando la estructura, operación y necesidades de información de las organizaciones, con apego a la ética profesional y el servicio a la sociedad. ', '2020-04-13 16:43:46', '3983d4ee810ee7391a52f07b4d2eff0d', 1, 1, 1, '*', '2020-02-07 06:52:00', '0000-00-00 00:00:00', '2020-02-07 06:52:00', '0000-00-00 00:00:00', 0, 0, 4, );
INSERT INTO `sreud_finder_links` (`link_id`, `url`, `route`, `title`, `description`, `indexdate`, `md5sum`, `published`, `state`, `access`, `language`, `publish_start_date`, `publish_end_date`, `start_date`, `end_date`, `list_price`, `sale_price`, `type_id`, `object`) VALUES
(18, 'index.php?option=com_content&view=article&id=4', 'index.php?option=com_content&view=article&id=4:perfil-de-ingreso-objetivos&catid=8', 'Perfil de ingreso (Objetivos)', ' Las competencias deseables, para el perfil de ingreso, seleccionadas de entre las establecidas para el Sistema Nacional de Bachillerato, según el acuerdo 444 de la SEP, son: Matemáticas Construye e interpreta modelos matemáticos mediante la aplicación de procedimientos aritméticos, algebraicos, geométricos y variacionales, para la comprensión y análisis de situaciones reales, hipotéticas o formales. Formula y resuelve problemas matemáticos, aplicando diferentes enfoques. Explica e interpreta los resultados obtenidos mediante procedimientos matemáticos y los contrasta con modelos establecidos o situaciones reales. Argumenta la solución obtenida de un problema, con métodos numéricos, gráficos, analíticos o variacionales, mediante el lenguaje verbal, matemático y el uso de las tecnologías de la información y la comunicación. Analiza las relaciones entre dos o más variables de un proceso social o natural para determinar o estimar su comportamiento. Cuantifica, representa y contrasta experimental o matemáticamente las magnitudes del espacio y las propiedades físicas de los objetos que lo rodean. Elige un enfoque determinista o uno aleatorio para el estudio de un proceso o fenómeno, y argumenta su pertinencia. Interpreta tablas, gráficas, mapas, diagramas y textos con símbolos matemáticos y científicos. ', '2020-04-13 16:43:47', 'e5e6ad13135e41aa22bf7a24d5d76f55', 1, 1, 1, '*', '2020-02-07 06:58:01', '0000-00-00 00:00:00', '2020-02-07 06:58:01', '0000-00-00 00:00:00', 0, 0, 4, ),
(19, 'index.php?option=com_content&view=article&id=5', 'index.php?option=com_content&view=article&id=5:libreria-con-realidad-aumentada&catid=11', 'Librería con realidad aumentada', ' La biblioteca del Campus de Ciencias Exactas e Ingeniería ofrece más de 48,568 volúmenes y en muchas ocasiones requiere mucho tiempo la búsqueda de uno de éstos. Una aplicación basada en Realidad Aumentada propone resolver el desconocimiento espacial de los usuarios de la biblioteca. ', '2020-04-13 16:43:48', '6b9e6f2c0dfcc9862caca67f449538fd', 1, 1, 1, '*', '2020-02-07 07:28:28', '0000-00-00 00:00:00', '2020-02-07 07:28:28', '0000-00-00 00:00:00', 0, 0, 4, ),
