(61, 'index.php?option=com_content&view=article&id=32', 'index.php?option=com_content&view=article&id=32:infografia-prueba&catid=15', 'Infografia prueba', ' Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum. ', '2020-04-13 19:34:22', 'aac334d1a69f847c2895964d10c8f995', 1, 0, 1, '*', '2020-04-14 00:28:08', '0000-00-00 00:00:00', '2020-04-14 00:28:08', '0000-00-00 00:00:00', 0, 0, 4, );
