(62, 'index.php?option=com_content&view=article&id=27', 'index.php?option=com_content&view=article&id=27:infografia-wifi-vs-ethernet&catid=15', 'Infografía \"Ethernet\"', ' ', '2020-04-13 19:35:01', 'df79528e51dec0055531f761ad160c37', 1, 1, 1, '*', '2020-04-09 22:39:01', '0000-00-00 00:00:00', '2020-04-09 22:39:01', '0000-00-00 00:00:00', 0, 0, 4, ),
(63, 'index.php?option=com_content&view=article&id=33', 'index.php?option=com_content&view=article&id=33:prueba-futuro-y-ciencia&catid=15', 'Prueba futuro y ciencia ', ' Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum. ', '2020-04-13 20:10:22', '9b4bb3761d89290a48e53144c4ed35ef', 1, 1, 1, '*', '2020-04-14 01:10:22', '0000-00-00 00:00:00', '2020-04-14 01:10:22', '0000-00-00 00:00:00', 0, 0, 4, ),
(64, 'index.php?option=com_content&view=article&id=22', 'index.php?option=com_content&view=article&id=22:proposito-del-sitio&catid=8', 'Propósito del sitio', ' El portal “Jóvenes en las Ciencias de la Computación” es un espacio para compartir materiales de divulgación científica en el área de las Ciencias de la Computación e información de productos generados por la comunidad de los programas de computación de la Facultad de Matemáticas. Se incluyen secciones con información escrita en lenguaje accesible para los jóvenes y en diversos formatos: artículos, infografías, videos y galerías fotográficas. El espacio Futuro y Ciencia, está dedicado a la publicación de contenido sobre las diversas áreas de las Ciencias de la Computación: inteligencia artificial, redes de computadoras, realidad virtual, aprendizaje automático, internet de las cosas, etc. Es posible recibir aportaciones de alumnos, profesores o divulgadores de la ciencia externos a la institución, siguiendo los lineamientos correspondientes. Nuestro sitio está dirigido a adolescentes y adultos que buscan conocer con mayor detalle lo que se estudia en la carrera de Ciencias de la Computación y acceder a material de divulgación científica y comprender las aplicaciones que tiene las Ciencias de la Computación en la vida cotidiana. ', '2020-04-23 01:29:26', 'deb41b0b85325eb65b793c291944e000', 1, 1, 1, '*', '2020-03-23 21:34:02', '0000-00-00 00:00:00', '2020-03-23 21:34:02', '0000-00-00 00:00:00', 0, 0, 4, );
