(48, 8, 1, '', '2020-03-12 07:06:34', 136, 2562, '2cf6ad2ec56358702c786acb2a268692c1caf89a', '{\"id\":8,\"asset_id\":\"81\",\"title\":\"Laboratorio de interconexi\\u00f3n inal\\u00e1mbrica\",\"alias\":\"laboratorio-de-interconexion-inalambrica\",\"introtext\":\"<p>Se disen\\u0303o un laboratorio para representar un ambiente de interconexio\\u0301n mo\\u0301vil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y ca\\u0301maras de video vigilancia. Este entorno se utiliza para la realizaci\\u00f3n de pra\\u0301cticas y proyectos para las materias de computacio\\u0301n impartidas en la Facultad de Matema\\u0301ticas. El sistema permite analizar el proceso de la comunicacio\\u0301n, los protocolos de red y sus caracteri\\u0301sticas, esto como tema de estudio de los modelos OSI y TCP\\/IP. Tambi\\u00e9n, se utilizan equipos de video vigilancia y se obtiene video en tiempo real como datos utilizables por otras aplicaciones.<\\/p>\\r\\n<p>{os-gal-5}<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"12\",\"created\":\"2020-03-04 23:39:00\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-12 07:06:34\",\"modified_by\":\"136\",\"checked_out\":\"136\",\"checked_out_time\":\"2020-03-12 07:06:26\",\"publish_up\":\"2020-03-04 23:39:00\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\