(61, 7, 1, '', '2020-03-13 04:43:32', 136, 2941, '2e8cb6bb2ba3bbb64546477fd6463611d47bab0e', '{\"id\":7,\"asset_id\":\"80\",\"title\":\"Simulador de sistema operativo y lenguaje ensamblador\",\"alias\":\"simulador-de-sistema-operativo-y-lenguaje-ensamblador\",\"introtext\":\"<p>En este trabajo se analiza e implementa un simulador de un sistema operativo y tambi\\u00e9n el software que permite traducir c\\u00f3digo fuente escrito en ensamblador a c\\u00f3digo de m\\u00e1quina del simulador; adem\\u00e1s de otras herramientas de programaci\\u00f3n de sistemas, como son: traductores, editores y subrutinas del sistema operativo. El programa, simula una computadora virtual con una arquitectura simplificada y m\\u00f3dulos para generar ejecutables a partir del lenguaje ensamblador, un m\\u00f3dulo para manejo de procesos, m\\u00f3dulo para manejo de memoria y una secci\\u00f3n para el control de simulaciones. El simulador permite a los usuarios implementar rutinas para ampliar las funcionalidades del sistema. El simulador tambi\\u00e9n se puede emplear para hacer pr\\u00e1cticas para ayudar en la comprensi\\u00f3n de la arquitectura de las computadoras, el manejo de lenguaje m\\u00e1quina, el manejo de lenguaje ensamblador y el funcionamiento de un sistema operativo con sus algoritmos de gesti\\u00f3n.<\\/p>\\r\\n<p>{gallery}Articulo_3_Ayala{\\/gallery}<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"9\",\"created\":\"2020-03-04 23:35:11\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-13 04:43:32\",\"modified_by\":\"136\",\"checked_out\":\"136\",\"checked_out_time\":\"2020-03-13 04:31:58\",\"publish_up\":\"2020-03-04 23:35:11\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"