(111, 4, 1, '', '2020-03-13 19:54:10', 136, 3561, 'd46ff76ac1b6f155d26ea1e9a2a301b24988f527', '{\"id\":4,\"asset_id\":\"69\",\"title\":\"Perfil de ingreso (Objetivos)\",\"alias\":\"perfil-de-ingreso-objetivos\",\"introtext\":\"<p>\\u00a0<\\/p>\\r\\n<p style=\\\"text-align: center;\\\"><img src=\\\"images\\/logoLCC.jpg\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<p>Las competencias deseables, para el perfil de ingreso, seleccionadas de entre las establecidas para el Sistema Nacional de Bachillerato, seg\\u00fan el acuerdo 444 de la SEP, son:<\\/p>\\r\\n<p><b><i>Matem\\u00e1ticas<\\/i><\\/b><\\/p>\\r\\n<ol type=\\\"1\\\">\\r\\n<li>Construye e interpreta modelos matem\\u00e1ticos mediante la aplicaci\\u00f3n de procedimientos aritm\\u00e9ticos, algebraicos, geom\\u00e9tricos y variacionales, para la comprensi\\u00f3n y an\\u00e1lisis de situaciones reales, hipot\\u00e9ticas o formales.<\\/li>\\r\\n<li>Formula y resuelve problemas matem\\u00e1ticos, aplicando diferentes enfoques.<\\/li>\\r\\n<li>Explica e interpreta los resultados obtenidos mediante procedimientos matem\\u00e1ticos y los contrasta con modelos establecidos o situaciones reales.<\\/li>\\r\\n<li>Argumenta la soluci\\u00f3n obtenida de un problema, con m\\u00e9todos num\\u00e9ricos, gr\\u00e1ficos, anal\\u00edticos o variacionales, mediante el lenguaje verbal, matem\\u00e1tico y el uso de las tecnolog\\u00edas de la informaci\\u00f3n y la comunicaci\\u00f3n.<\\/li>\\r\\n<li>Analiza las relaciones entre dos o m\\u00e1s variables de un proceso social o natural para determinar o estimar su comportamiento.<\\/li>\\r\\n<li>Cuantifica, representa y contrasta experimental o matem\\u00e1ticamente las magnitudes del espacio y las propiedades f\\u00edsicas de los objetos que lo rodean.<\\/li>\\r\\n<li>Elige un enfoque determinista o uno aleatorio para el estudio de un proceso o fen\\u00f3meno, y argumenta su pertinencia.<\\/li>\\r\\n<li>Interpreta tablas, gr\\u00e1ficas, mapas, diagramas y textos con s\\u00edmbolos matem\\u00e1ticos y cient\\u00edficos.<\\/li>\\r\\n<\\/ol>\\r\\n<p>\\u00a0<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2020-02-07 06:58:01\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-13 19:54:10\",\"modified_by\":\"136\",\"checked_out\":\"136\",\"checked_out_time\":\"2020-03-13 19:53:38\",\"publish_up\":\"2020-02-07 06:58:01\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":7,\"ordering\":\"1\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"19\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(126, 8, 1, '', '2020-03-21 01:44:32', 136, 3393, '22e025beeb32c8341e36f9e077e8639287ffda47', '{\"id\":8,\"asset_id\":\"81\",\"title\":\"Laboratorio de Interconexi\\u00f3n Inal\\u00e1mbrica\",\"alias\":\"laboratorio-de-interconexion-inalambrica\",\"introtext\":\"<p>Se disen\\u0303\\u00f3 un laboratorio para representar un ambiente de interconexio\\u0301n mo\\u0301vil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y ca\\u0301maras de video vigilancia.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Se disen\\u0303\\u00f3 un laboratorio para representar un ambiente de interconexio\\u0301n mo\\u0301vil, utilizando diversos equipos de comunicaciones, mecanismos de seguridad de redes y ca\\u0301maras de video vigilancia. Este entorno se utiliza para la realizaci\\u00f3n de pra\\u0301cticas y proyectos para las materias de computacio\\u0301n impartidas en la Facultad de Matema\\u0301ticas. El sistema permite analizar el proceso de la comunicacio\\u0301n, los protocolos de red y sus caracteri\\u0301sticas, esto como tema de estudio de los modelos OSI y TCP\\/IP. Tambi\\u00e9n, se utilizan equipos de video vigilancia y se obtiene video en tiempo real como datos utilizables por otras aplicaciones.<\\/p>\\r\\n<p>{gallery}Articulo_9_Cervera{\\/gallery}<\\/p>\\r\\n<h4>Manual de Utilizaci\\u00f3n<\\/h4>\\r\\n<p>{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"700\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/Articulo_9_Cervera\\/Modelo_Didactico_manual_Laboratorio_de_interconexion.pdf{\\/aridoc}<\\/p>\\r\\n<p>&lt;iframe width=\\\"560\\\" height=\\\"315\\\" src=\\\"https:\\/\\/www.youtube.com\\/embed\\/paP45j1LIsM\\\" frameborder=\\\"0\\\" allow=\\\"accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture\\\" allowfullscreen&gt;&lt;\\/iframe&gt;<\\/p>\",\"state\":1,\"catid\":\"12\",\"created\":\"2020-03-04 23:39:00\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-21 01:44:32\",\"modified_by\":\"136\"