(148, 3, 1, '', '2020-03-21 06:33:47', 135, 2764, 'b2d0e0132f3fae6fafd2a3f04cec2beed93f0a5a', '{\"id\":3,\"asset_id\":\"68\",\"title\":\"Misi\\u00f3n y Visi\\u00f3n (Objetivos)\",\"alias\":\"mision-y-vision-objetivos\",\"introtext\":\"<p style=\\\"text-align: center;\\\"><img style=\\\"margin-right: 140px; margin-left: 140px;\\\" src=\\\"images\\/logoLCC.jpg\\\" width=\\\"750\\\" height=\\\"154\\\" \\/><\\/p>\\r\\n<p>El prop\\u00f3sito del plan de estudios de la Licenciatura en Ciencias de la Computaci\\u00f3n es:<\\/p>\\r\\n<p><b><i>Formar profesionales competentes en el \\u00e1rea de las ciencias de la computaci\\u00f3n para desarrollar y gestionar tecnolog\\u00eda computacional; realizar actividades de investigaci\\u00f3n cient\\u00edfica; dise\\u00f1ar e implementar software de base y software de aplicaci\\u00f3n, novedosos y eficientes; considerando la estructura, operaci\\u00f3n y necesidades de informaci\\u00f3n de las organizaciones, con apego a la \\u00e9tica profesional y el servicio a la sociedad.<\\/i><\\/b><\\/p>\\r\\n<p><b><i><iframe src=\\\"https:\\/\\/www.youtube.com\\/embed\\/paP45j1LIsM\\\" width=\\\"560\\\" height=\\\"315\\\" frameborder=\\\"0\\\" allowfullscreen=\\\"allowfullscreen\\\"><\\/iframe><\\/i><\\/b><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2020-02-07 06:52:00\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-21 06:33:47\",\"modified_by\":\"135\",\"checked_out\":\"135\",\"checked_out_time\":\"2020-03-21 06:33:06\",\"publish_up\":\"2020-02-07 06:52:00\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_publishing_options\\\":\\\"\\\",\\\"show_article_options\\\":\\\"\\\",\\\"show_urls_images_backend\\\":\\\"\\\",\\\"show_urls_images_frontend\\\":\\\"\\\"}\",\"version\":2,\"ordering\":\"2\",\"metakey\":\"\",\"metadesc\":\"\",\"access\":\"1\",\"hits\":\"20\",\"metadata\":\"{\\\"robots\\\":\\\"\\\",\\\"author\\\":\\\"\\\",\\\"rights\\\":\\\"\\\",\\\"xreference\\\":\\\"\\\"}\",\"featured\":\"0\",\"language\":\"*\",\"xreference\":\"\",\"note\":\"\"}', 0),
(149, 4, 1, '', '2020-03-21 06:34:40', 135, 3716, 'e8453b17c20e37dbcc193f6d47ed03d008b6b2b7', '{\"id\":4,\"asset_id\":\"69\",\"title\":\"Perfil de ingreso (Objetivos)\",\"alias\":\"perfil-de-ingreso-objetivos\",\"introtext\":\"<p>\\u00a0<\\/p>\\r\\n<p style=\\\"text-align: center;\\\"><img src=\\\"images\\/logoLCC.jpg\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<p>Las competencias deseables, para el perfil de ingreso, seleccionadas de entre las establecidas para el Sistema Nacional de Bachillerato, seg\\u00fan el acuerdo 444 de la SEP, son:<\\/p>\\r\\n<p><b><i>Matem\\u00e1ticas<\\/i><\\/b><\\/p>\\r\\n<ol type=\\\"1\\\">\\r\\n<li>Construye e interpreta modelos matem\\u00e1ticos mediante la aplicaci\\u00f3n de procedimientos aritm\\u00e9ticos, algebraicos, geom\\u00e9tricos y variacionales, para la comprensi\\u00f3n y an\\u00e1lisis de situaciones reales, hipot\\u00e9ticas o formales.<\\/li>\\r\\n<li>Formula y resuelve problemas matem\\u00e1ticos, aplicando diferentes enfoques.<\\/li>\\r\\n<li>Explica e interpreta los resultados obtenidos mediante procedimientos matem\\u00e1ticos y los contrasta con modelos establecidos o situaciones reales.<\\/li>\\r\\n<li>Argumenta la soluci\\u00f3n obtenida de un problema, con m\\u00e9todos num\\u00e9ricos, gr\\u00e1ficos, anal\\u00edticos o variacionales, mediante el lenguaje verbal, matem\\u00e1tico y el uso de las tecnolog\\u00edas de la informaci\\u00f3n y la comunicaci\\u00f3n.<\\/li>\\r\\n<li>Analiza las relaciones entre dos o m\\u00e1s variables de un proceso social o natural para determinar o estimar su comportamiento.<\\/li>\\r\\n<li>Cuantifica, representa y contrasta experimental o matem\\u00e1ticamente las magnitudes del espacio y las propiedades f\\u00edsicas de los objetos que lo rodean.<\\/li>\\r\\n<li>Elige un enfoque determinista o uno aleatorio para el estudio de un proceso o fen\\u00f3meno, y argumenta su pertinencia.<\\/li>\\r\\n<li>Interpreta tablas, gr\\u00e1ficas, mapas, diagramas y textos con s\\u00edmbolos matem\\u00e1ticos y cient\\u00edficos.<\\/li>\\r\\n<\\/ol>\\r\\n<p>\\u00a0<iframe src=\\\"https:\\/\\/www.youtube.com\\/embed\\/paP45j1LIsM\\\" width=\\\"560\\\" height=\\\"315\\\" frameborder=\\\"0\\\" allowfullscreen=\\\"allowfullscreen\\\"><\\/iframe><\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2020-02-07 06:58:01\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-03-21 06:34:40\",\"modified_by\":\"135\",\"checked_out\":\"135\",\"checked_out_time\":\"2020-03-21 06:34:20\",\"publish_up\":\"2020-02-07 06:58:01\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"show_title\\\":\\\"\\\",\\\"link_titles\\\":\\\"\\\",\\\"show_tags\\\":\\\"\\\",\\\"show_intro\\\":\\\"\\\",\\\"info_block_position\\\":\\\"\\\",\\\"info_block_show_title\\\":\\\"\\\",\\\"show_category\\\":\\\"\\\",\\\"link_category\\\":\\\"\\\",\\\"show_parent_category\\\":\\\"\\\",\\\"link_parent_category\\\":\\\"\\\",\\\"show_associations\\\":\\\"\\\",\\\"show_author\\\":\\\"\\\",\\\"link_author\\\":\\\"\\\",\\\"show_create_date\\\":\\\"\\\",\\\"show_modify_date\\\":\\\"\\\",\\\"show_publish_date\\\":\\\"\\\",\\\"show_item_navigation\\\":\\\"\\\",\\\"show_icons\\\":\\\"\\\",\\\"show_print_icon\\\":\\\"\\\",\\\"show_email_icon\\\":\\\"\\\",\\\"show_vote\\\":\\\"\\\",\\\"show_hits\\\":\\\"\\\",\\\"show_noauth\\\":\\\"\\\",\\\"urls_position\\\":\\\"\\\",\\\"alternative_readmore\\\":\\\"\\\",\\\"article_page_title\\\":\\\"\\\",\\\"show_