(153, 4, 1, '', '2020-03-21 06:40:07', 135, 4055, 'e1d8543b11dfe4b69ea6d393af86751108a9196b', '{\"id\":4,\"asset_id\":\"69\",\"title\":\"Perfil de ingreso (Objetivos)\",\"alias\":\"perfil-de-ingreso-objetivos\",\"introtext\":\"<p>\\u00a0<\\/p>\\r\\n<p style=\\\"text-align: center;\\\"><img src=\\\"images\\/logoLCC.jpg\\\" alt=\\\"\\\" \\/><\\/p>\\r\\n<p style=\\\"text-align: justify;\\\">Las competencias deseables, para el perfil de ingreso, seleccionadas de entre las establecidas para el Sistema Nacional de Bachillerato, seg\\u00fan el acuerdo 444 de la SEP, son:<\\/p>\\r\\n<p style=\\\"text-align: justify;\\\"><b><i>Matem\\u00e1ticas<\\/i><\\/b><\\/p>\\r\\n<ol type=\\\"1\\\">\\r\\n<li style=\\\"text-align: justify;\\\">Construye e interpreta modelos matem\\u00e1ticos mediante la aplicaci\\u00f3n de procedimientos aritm\\u00e9ticos, algebraicos, geom\\u00e9tricos y variacionales, para la comprensi\\u00f3n y an\\u00e1lisis de situaciones reales, hipot\\u00e9ticas o formales.<\\/li>\\r\\n<li style=\\\"text-align: justify;\\\">Formula y resuelve problemas matem\\u00e1ticos, aplicando diferentes enfoques.<\\/li>\\r\\n<li style=\\\"text-align: justify;\\\">Explica e interpreta los resultados obtenidos mediante procedimientos matem\\u00e1ticos y los contrasta con modelos establecidos o situaciones reales.<\\/li>\\r\\n<li style=\\\"text-align: justify;\\\">Argumenta la soluci\\u00f3n obtenida de un problema, con m\\u00e9todos num\\u00e9ricos, gr\\u00e1ficos, anal\\u00edticos o variacionales, mediante el lenguaje verbal, matem\\u00e1tico y el uso de las tecnolog\\u00edas de la informaci\\u00f3n y la comunicaci\\u00f3n.<\\/li>\\r\\n<li style=\\\"text-align: justify;\\\">Analiza las relaciones entre dos o m\\u00e1s variables de un proceso social o natural para determinar o estimar su comportamiento.<\\/li>\\r\\n<li style=\\\"text-align: justify;\\\">Cuantifica, representa y contrasta experimental o matem\\u00e1ticamente las magnitudes del espacio y las propiedades f\\u00edsi