(341, 28, 1, '', '2020-04-12 14:14:15', 135, 2965, '0504dba23d54c54b939b750d1604dbceac8a4954', '{\"id\":28,\"asset_id\":\"134\",\"title\":\" Realidad Aumentada en un croquis 3D interactivo de la Facultad de Matem\\u00e1ticas\",\"alias\":\"realidad-aumentada-en-un-croquis-3d-interactivo-de-la-facultad-de-matematicas\",\"introtext\":\"<p>Se realiz\\u00f3 una aplicaci\\u00f3n m\\u00f3vil de Realidad Aumentada que despliega un escenario virtual tridimensional de la facultad de matem\\u00e1ticas<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Como parte de un proyecto, se realiz\\u00f3 una aplicaci\\u00f3n m\\u00f3vil de Realidad Aumentada que despliegue un escenario virtual tridimensional de la facultad de matem\\u00e1ticas de tal manera que el usuario pueda identificar la ubicaci\\u00f3n de edificios principales de la facultad de matem\\u00e1ticas, as\\u00ed como los pasillos que dirigen a estos, desde una perspectiva general y de manera interactiva.<\\/p>\\r\\n<p>En el siguiente documento se describe todo lo que conllev\\u00f3 la realizaci\\u00f3n del proyecto.<\\/p>\\r\\n<h4>Trabajo Realizado<\\/h4>\\r\\n<p>{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"700\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/articulos\\/esto_hacemos\\/Articulo_12_RealidadAumentada_FMAT\\/Proyecto_integrador_Alan.pdf{\\/aridoc}<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"state\":1,\"catid\":\"2\",\"created\":\"2020-04-11 16:25:28\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-04-12 14:14:15\",\"modified_by\":\"135\",\"checked_out\":\"135\",\"checked_out_time\":\"2020-04-12 13:44:11\",\"publish_up\":\"2020-04-11 16:25:28\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/articulos\\\\\\/esto_hacemos\\\\\\/Articulo_12_RealidadAumentada_FMAT\\\\\\/croquis_fmat.jpg\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\