(354, 29, 1, '', '2020-04-12 15:35:46', 135, 3445, '6f31d8dcc6611280ba33fc9cff3f0c66e969c98e', '{\"id\":29,\"asset_id\":\"135\",\"title\":\"Ubicampus, la aplicaci\\u00f3n para ubicar salones escolares en FMAT\",\"alias\":\"ubicampus-la-aplicacion-para-ubicar-salones-escolares-en-fmat\",\"introtext\":\"<p>\\u00a0Aplicaci\\u00f3n de realidad aumentada que sirve para visualizar informaci\\u00f3n de los salones de clase y de los departamentos de la Facutlad de Matem\\u00e1ticas<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Este proyecto surge de la problem\\u00e1tica de que muchos estudiantes que est\\u00e1n empezando a estudiar en la Facultad de Matem\\u00e1ticas no pueden encontrar sus salones de clases, se pierden o no est\\u00e1n seguros de su sal\\u00f3n de clases; tambi\\u00e9n no saben ubicar bien los departamentos de la facultad.<\\/p>\\r\\n<p>Se propone la creaci\\u00f3n una aplicaci\\u00f3n de realidad aumentada con el nombre de \\u201cUbicampus\\u201d, en la cual, el usuario podr\\u00e1 enfocar su c\\u00e1mara en el identificador de un sal\\u00f3n (D3, H5), y \\u00e9sta arrojar\\u00e1 una lista donde se podr\\u00e1 visualizar cu\\u00e1ndo se ocupa el sal\\u00f3n, por qu\\u00e9 materia y qu\\u00e9 maestro la imparte. De igual modo, para los departamentos de la universidad, esta aplicaci\\u00f3n desplegar\\u00e1 informaci\\u00f3n referente al departamento, indic\\u00e1ndole al usuario los servicios que \\u00e9ste presenta (por ejemplo, en Control Escolar se deplegar\\u00e1 la funci\\u00f3n, as\\u00ed como tr\\u00e1mites que puedes realizar tal como solicitud de constancias).<\\/p>\\r\\n<h4>Trabajo Realizado<\\/h4>\\r\\n<p>{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"700\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/articulos\\/esto_hacemos\\/Articulo_3_Ayala\\/IJCTT-V51P109.pdf{\\/aridoc}<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"state\":1,\"catid\":\"10\",\"created\":\"2020-04-11 16:26:00\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"202