(359, 11, 1, '', '2020-04-12 16:44:50', 135, 3306, '371f2e0559939e2519678205cee800a5992a163f', '{\"id\":11,\"asset_id\":\"84\",\"title\":\"Veh\\u00edculos Aut\\u00f3nomos: Detecci\\u00f3n de obst\\u00e1culos con la aplicaci\\u00f3n de redes neuronales convolucionales\",\"alias\":\"vehiculos-autonomos-deteccion-de-obstaculos-con-la-aplicacion-de-redes-neuronales-convolucionales\",\"introtext\":\"<p>Se propone el desarrollo de un modelo neuronal CNN con arquitectura codificadora-decodificadora para la clasificaci\\u00f3n de obst\\u00e1culos en im\\u00e1genes de un sistema de visi\\u00f3n monocular, a cargo de L.C.C. Albert Aar\\u00f3n Cervera Uribe.<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>En a\\u00f1os recientes, el uso de CNN\\u2019s ha llevado al desarrollo de trabajos notables en clasificaci\\u00f3n de im\\u00e1genes, sin embargo, en tareas de veh\\u00edculos aut\\u00f3nomos, la salida deseada de la red debe incluir no s\\u00f3lo la etiqueta de predicci\\u00f3n, pero la localizaci\\u00f3n de objetos de inter\\u00e9s preferentemente a nivel de p\\u00edxeles.<\\/p>\\r\\n<p>Este trabajo propone el desarrollo de un modelo neuronal CNN con arquitectura codificadora-decodificadora para la detecci\\u00f3n de obst\\u00e1culos en im\\u00e1genes de un sistema de visi\\u00f3n monocular para veh\\u00edculos aut\\u00f3nomos.<\\/p>\\r\\n<p>En este reporte se muestran los resultados obtenidos en materia de detecci\\u00f3n de obst\\u00e1culos con la aplicaci\\u00f3n de redes neuronales convolucionales.<\\/p>\\r\\n<h4>Trabajo Realizado<\\/h4>\\r\\n<p>{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"700\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/articulos\\/esto_hacemos\\/Articulo_2_Cervera_Uribe\\/Towards_Autonomous_Vehicles_with_CNN_[Albert_Cervera-Uribe].pdf{\\/aridoc}<\\/p>\",\"state\":1,\"catid\":\"11\",\"created\":\"2020-03-05 08:17:18\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-04-12 16:44:50\",\"modified_by\":\"135\",\"checked_out