(361, 24, 1, '', '2020-04-12 17:16:21', 135, 2608, 'f7b101528597f05197d71e476a51eb06d47159ba', '{\"id\":24,\"asset_id\":\"138\",\"title\":\"Adivina al Geometronix\",\"alias\":\"adivina-quien-de-geometria\",\"introtext\":\"<p>El cl\\u00e1sico juego de \\u00a1Adivina Qui\\u00e9n!,\\u00a0pero\\u00a0ahora enfocado a la Geometr\\u00eda<\\/p>\\r\\n\",\"fulltext\":\"\\r\\n<p>Este ejemplo de\\u00a0Aprendizaje Interactivo Multiusuario, se implement\\u00f3 el uso de aplicaciones m\\u00f3viles como recursos alternativos para el aprendizaje de nociones matem\\u00e1ticas en el Nivel B\\u00e1sico.<\\/p>\\r\\n<p>{gallery}articulos\\/esto_hacemos\\/Articulo_5_BastoGeometronix{\\/gallery}<\\/p>\\r\\n<h4>Manual de Usuario \\\"Adivina al Geometronix\\\"<\\/h4>\\r\\n<p>{aridoc engine=\\\"pdfjs\\\" width=\\\"100%\\\" height=\\\"650\\\"}http:\\/\\/localhost\\/serviciosocial\\/images\\/articulos\\/esto_hacemos\\/Articulo_5_BastoGeometronix\\/Manual_Usuario-AdivinaAlGeometronix.pdf{\\/aridoc}<\\/p>\\r\\n<p>\\u00a0<\\/p>\",\"state\":1,\"catid\":\"10\",\"created\":\"2020-04-03 12:56:44\",\"created_by\":\"136\",\"created_by_alias\":\"\",\"modified\":\"2020-04-12 17:16:21\",\"modified_by\":\"135\",\"checked_out\":\"135\",\"checked_out_time\":\"2020-04-12 17:15:58\",\"publish_up\":\"2020-04-03 12:56:44\",\"publish_down\":\"0000-00-00 00:00:00\",\"images\":\"{\\\"image_intro\\\":\\\"images\\\\\\/articulos\\\\\\/esto_hacemos\\\\\\/Articulo_5_BastoGeometronix\\\\\\/2menu_principal.PNG\\\",\\\"float_intro\\\":\\\"\\\",\\\"image_intro_alt\\\":\\\"\\\",\\\"image_intro_caption\\\":\\\"\\\",\\\"image_fulltext\\\":\\\"\\\",\\\"float_fulltext\\\":\\\"\\\",\\\"image_fulltext_alt\\\":\\\"\\\",\\\"image_fulltext_caption\\\":\\\"\\\"}\",\"urls\":\"{\\\"urla\\\":false,\\\"urlatext\\\":\\\"\\\",\\\"targeta\\\":\\\"\\\",\\\"urlb\\\":false,\\\"urlbtext\\\":\\\"\\\",\\\"targetb\\\":\\\"\\\",\\\"urlc\\\":false,\\\"urlctext\\\":\\\"\\\",\\\"targetc\\\":\\\"\\\"}\",\"attribs\":\"{\\\"article_layout\\\":\\\"\\\",\\\"