(363, 22, 1, '', '2020-04-13 21:18:59', 135, 3198, '2e0b7426f881bf1adde04b8d9c5ba461933f562d', '{\"id\":22,\"asset_id\":\"102\",\"title\":\"Prop\\u00f3sito del sitio\",\"alias\":\"proposito-del-sitio\",\"introtext\":\"<p>El portal \\u201cJ\\u00f3venes en las Ciencias de la Computaci\\u00f3n\\u201d es un espacio para compartir materiales de divulgaci\\u00f3n cient\\u00edfica en el \\u00e1rea de las Ciencias de la Computaci\\u00f3n e informaci\\u00f3n de productos generados por la comunidad de los programas de computaci\\u00f3n de la Facultad de Matem\\u00e1ticas.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p>Se incluyen secciones con informaci\\u00f3n escrita en lenguaje accesible para los j\\u00f3venes y en diversos formatos: art\\u00edculos, infograf\\u00edas, videos y galer\\u00edas fotogr\\u00e1ficas.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p>El espacio <strong>Futuro y Ciencia<\\/strong>, est\\u00e1 dedicado a la publicaci\\u00f3n de contenido sobre las diversas \\u00e1reas de las Ciencias de la Computaci\\u00f3n: inteligencia artificial, redes de computadoras, realidad virtual, aprendizaje autom\\u00e1tico, internet de las cosas, etc. Es posible recibir aportaciones de alumnos, profesores o divulgadores de la ciencia externos a la instituci\\u00f3n, siguiendo los lineamientos correspondientes.<\\/p>\\r\\n<p>\\u00a0<\\/p>\\r\\n<p>Nuestro sitio est\\u00e1 dirigido a adolescentes y adultos que buscan conocer con mayor detalle lo que se estudia en la carrera de Ciencias de la Computaci\\u00f3n y acceder a material de divulgaci\\u00f3n cient\\u00edfica y comprender las aplicaciones que tiene las Ciencias de la Computaci\\u00f3n en la vida cotidiana.<\\/p>\",\"fulltext\":\"\",\"state\":1,\"catid\":\"8\",\"created\":\"2020-03-23 21:34:02\",\"created_by\":\"135\",\"created_by_alias\":\"\",\"modified\":\"2020-04-13 21:18:59\",\"modified_by\":\"135\",\"checked_out\":\"135\",\"checked_out_time\":\"2020-04-13 21:18:52\",\"publish_up\":\"2020-03-23 21:34:02\",\"publish_down\":\"0000-00-00 